// src/pages/rickTable.js

import { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

const API_URL = " https://rickandmortyapi.com/";

function RickAndMortyTable() {
  const [character, setCharacters] = useState([]);
  const [locations, setLocations] = useState([]);
  const [episodes, setEpisodes] = useState([]);

  const getAllCharacters = () => {
    axios
      .get(`${API_URL}/api/character`)
      .then((response) => {
          console.log('characters' , response);
          setCharacters(response.data)
      })
      .catch((error) => console.log(error));
  };

  // We set this effect will run only once, after the initial render
  // by setting the empty dependency array - []
  useEffect(() => {
    getAllCharacters();
  }, []);

  return (
    <div className="ProjectListPage">
      {character.map((project) => {
        return (
          <div className="ProjectCard card" key={project._id}>
            <Link to={`/projects/${project._id}`}>
              <h3>{project.title}</h3>
            </Link>
          </div>
        );
      })}
    </div>
  );
}

export default RickAndMortyTable;
